/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `t_film_status_change` AFTER UPDATE ON `film_status` FOR EACH ROW BEGIN 
	INSERT INTO logs (user_name, film_title, old_status, new_status)
	VALUES (
	(SELECT nickname FROM users WHERE id = NEW.for_user_id),
	(SELECT title FROM films WHERE id = NEW.target_film_id),
	OLD.status,
	NEW.status);
